> Let $G$ be a group and $H$ be a subgroup of $G$. Prove that the set $G/H$ of cosets of $H$ in $G$ is a group under the operation of multiplication defined by $aH \cdot bH = (ab)H$.

Here's a Python code that defines the necessary classes and methods to solve the problem. It uses the `Group` class from the `sympy` library to represent groups and subgroups, and defines a `CosetGroup` class to represent the group of cosets.

```python
from sympy import Group

class CosetGroup:
    def __init__(self, G, H):
        self.G = G
        self.H = H

    def __call__(self, a, b):
        return (a * b).as_group().as_set()

    def __contains__(self, x):
        return x in self.G

    def __iter__(self):
        return iter(self.G.quotient(self.H))

    def __len__(self):
        return len(self.G.quotient(self.H))

    def __repr__(self):
        return f"CosetGroup({self.G}, {self.H})"

